import React from 'react'
import { css } from "@emotion/react";
import PulseLoader from "react-spinners/PulseLoader";

const override = css`
  display: block;
  margin: 0 auto;
  border-color: red;
`;

const colors = {
  'primary': '#131E40'
}

export default function ActivityIndicator({ size = 10, color = 'primary' }) {
    return (
      <PulseLoader
        color={colors[color]}
        loading={true}
        css={override}
        size={size}
        speedMultiplier={0.8}
      />
    )
}
